import React from 'react';
import {Chart, ctx, data, options} from 'chart.js';

function Inicio(){
    var myBarChart = new Chart(ctx, {
        type: 'bar',
        data: data,
        options: options
    });
    return(
        <div>
            <h1>{myBarChart}</h1>
        </div>
    )
}

export default Inicio;
